import Button from 'react-bootstrap/Button';
import './HasNoParty.css';

const HasNoParty = ({ member }) => {
    return (
        <div className='hnp-wrapper content section bordered has-background-white'>

            <h4 className='title'>What do you want to do?</h4>
            <div className='hnp-button-group'>
                <Button variant='primary'>Host Party</Button>
                <Button variant='primary'>Join Party</Button>
            </div>

        </div>
    )   
}

export default HasNoParty;
